  false,\n\t\"url\": null,\n\t\"notes\": \"This report discusses managing mountain
  goat populations and their habitats on Kodiak Island. The long-term management goal
  of the Kodiak National Wildlife Refuge and the Alaska Department of Fish and Game
  is to maintain mountain goat abundances at levels that satisfy hunter harvest expectations
  while avoiding irreversible resource damage. To understand potential impacts of
  mountain goat's flora, managers need to understand the relationships between Kodiak
  mountain goats and their habitat.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
